import Login from "./Login";
import Signup from "./Signup";
import React from "react";
import './App.css';
import Navbar from '../components/Navbar/Navbar';
import Venue from './venue';
import WeddingDay from './weddingday';
import Discover from './discover';
import Music from './music';
import Gifts from './gifts';
import { BrowserRouter, Redirect, Route, withRouter, useLocation } from "react-router-dom";

import Index from "./Dashboard";
import { BrowserRouter as Router, AuthRoute, ProtectedRoute, Switch } from "../utils/route";

export default function App() {
    return ( 
      <div className ="App">
      <Router>
          <AuthRoute path="/" component={Login} />
          <div>
          <Navbar/>
          <AuthRoute path="/signup" component={Signup} />
          <ProtectedRoute path="/weddingDay" component={WeddingDay}/>
          <ProtectedRoute path="/gifts" component={Gifts}/>
          <ProtectedRoute path="/index" component={Index}/>
          <ProtectedRoute path="/venue" component={Venue}/>
          <ProtectedRoute path="/discover" component={Discover}/>
          <ProtectedRoute path="/music" component={Music}/>
          </div>
      </Router>
      </div>
    );
}
